<html lang="ko">

    <link rel="stylesheet" href="./css/main.css" />

    <div class="header">
      <div class="title">
        <h1 class="logo">CHANEL</h1>
        <div class="icons">
          <div id="my-form" class="invisible">
            <form action="#">
              <input type="text" placeholder="원하는 상품을 검색하세요" />
              <input type="submit" value="search" />
            </form>
          </div>
          <span id="search" title="검색"
            ><i class="fa-solid fa-magnifying-glass"></i
          ></span>
          <span id="my-page" title="나의 페이지"
            ><i class="fa-regular fa-user"></i
          ></span>
          <span id="wish" title="위시리스트"
            ><i class="fa-regular fa-star"></i
          ></span>
          <span id="shopcart" title="장바구니"
            ><i class="fa-solid fa-cart-shopping"></i
          ></span>
        </div>
      </div>
      <div class="nav">
        <a>하이라이트</a>
        <a>향수 컬렉션</a>
